import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';
import icon2 from "../img/222.png"
import icon3 from "../img/333.png"
import icon4 from "../img/444.png"
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';
import classes from "../styles/Karusel.module.css"

const Karusel = () => {
  return (
    <Swiper
      // install Swiper modules
      modules={[Navigation, Pagination, Scrollbar, A11y]}
      spaceBetween={50}
      slidesPerView={3}
      navigation
      pagination={{ clickable: true }}
      onSwiper={(swiper) => console.log(swiper)}
      onSlideChange={() => console.log('slide change')}
    >
      <SwiperSlide><img src={icon2} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon3} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon4} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon2} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon3} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon4} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon4} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon2} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon3} alt="" /></SwiperSlide>
      <SwiperSlide><img src={icon4} alt="" /></SwiperSlide>
      <div className={classes.dot}>...</div>
      {/* ... */}
    </Swiper>
  );
};

export default Karusel;
